from pybricks.hubs import PrimeHub
from pybricks.parameters import Direction, Port, Stop
from pybricks.pupdevices import Motor
from pybricks.robotics import DriveBase

# Set up all devices.
prime_hub = PrimeHub()
motor = Motor(Port.E, Direction.CLOCKWISE)
motor_2 = Motor(Port.A, Direction.COUNTERCLOCKWISE)
drive_base = DriveBase(motor_2, motor, 67, 130)
MotorAttach1 = Motor(Port.D, Direction.CLOCKWISE)
MotorAttach2 = Motor(Port.C, Direction.CLOCKWISE)


# The main program starts here.
drive_base.use_gyro(True)
drive_base.settings(straight_speed=500)
drive_base.settings(straight_acceleration=1000)
drive_base.straight(250)
drive_base.turn(20)
drive_base.straight(500)
drive_base.straight(-230)
MotorAttach2.run_angle(500, 70)
drive_base.straight(120)
MotorAttach2.run_angle(750, -90)
MotorAttach2.run_angle(500, 100)
drive_base.turn(-17)
drive_base.straight(-200)
drive_base.turn(32)
drive_base.straight(300)
drive_base.turn(-75)
drive_base.settings(straight_speed=200)
drive_base.settings(straight_acceleration=750)
drive_base.straight(280)
MotorAttach1.run_angle(200, -100)
drive_base.settings(straight_speed=500)
drive_base.settings(turn_acceleration=1000)
drive_base.straight(-225)
drive_base.turn(50)
drive_base.straight(-750)
